pm.test("Body is correct", function () {

    var jsonresponse = JSON.parse('[{"datetime": {"value": "2010-12-09T12:00:00"}, "fluiddensity": {"value": 8.0}, "fluidph": {"value": 7.0}, "topflow": {"value": 42.0}, "toppressure": {"value": 73.0}, "bottompressure": {"value": 73.0}, "bottomtemperature": {"value": 303.0}, "bottomflow": {"value": 42.0}, "toptemperature": {"value": 273.0}, "fluidviscosity": {"value": 0.5}}, {"datetime": {"value": "2010-12-09T13:00:00"}, "fluiddensity": {"value": 8.0}, "fluidph": {"value": 8.0}, "topflow": {"value": 52.0}, "toppressure": {"value": 83.0}, "bottompressure": {"value": 83.0}, "bottomtemperature": {"value": 313.0}, "bottomflow": {"value": 55.0}, "toptemperature": {"value": 290.0}, "fluidviscosity": {"value": 0.7}}]').sort((a, b) => (a.publicid > b.publicid) ? 1 : ((b.publicid > a.publicid) ? -1 : 0)); 

        var jsonData = pm.response.json().sort((a, b) => (a.publicid > b.publicid) ? 1 : ((b.publicid > a.publicid) ? -1 : 0)); 

    for(i=0; i<jsonData.length; i++){
        var diff = _.isEqual(jsonData[i], jsonresponse[i]);
        pm.expect(diff).to.eql(true);
    }

});

